import { styled } from 'styled-components';

const FooterEstilizado = styled.footer`
	display: flex;
	justify-content: space-between;
	align-items: center;
	width: 100%;
    background: rgb(0, 0, 0);
	padding: 2rem;
	box-sizing: border-box;
`;

const IconoContainer = styled.ul`
	margin: 0;
	padding: 0;
	list-style: none;
	li {
    	display: inline-block;
    	margin-right: 32px;
	}
`;

const FooterTexto = styled.p`
	font-size: 16px;
	color: white;
	margin: 0;
`;

function Footer() {
	return (
    	<PieEstilizado>
        	<IconoContainer>
            	<li>
                	<a href="#">
                    	<img src="/img/facebook.svg" alt="" />
                	</a>
            	</li>
            	<li>
                	<a href="#">
                    	<img src="/img/redes/twitter.svg" alt="" />
                	</a>
            	</li>
            	<li>
                	<a href="#">
                    	<img src="/img/redes/instagram.svg" alt="" />
                	</a>
            	</li>
        	</IconoContainer>
        	<PieTexto>Desarrollado por Alejandra Toloza</PieTexto>
    	</PieEstilizado>
	);
}

export default Footer;
